                    <FormGroup>
                      <Typography
                        variant="h7"
                        gutterBottom
                        style={{ color: '#45a29e', alignSelf: 'center' }}
                      >
                        Object Recognition
                      </Typography>
                      <FormControlLabel
                        control={<Switch onClick={console.log('test')} />}
                        label="OFF/ON"
                        style={{ alignSelf: 'center' }}
                      />
                      <Switch onChanged={console.log('test')} />
                    </FormGroup>
                  </Tooltip>
                </Grid>
                <Grid item xs={2} style={{ color: '#fff' }}>
                  <Tooltip
                    disableFocusListener
