                      >
                        Human Recognition
                      </Typography>
                      <FormControlLabel
                        control={<Switch />}
                        label="OFF/ON"
                        style={{ alignSelf: 'center' }}
                      />
                    </FormGroup>
                  </Tooltip>
                </Grid>
                <Grid item xs={2} style={{ color: '#fff' }}>
                  <Tooltip
